  false,\n\t\"url\": null,\n\t\"notes\": \"The bedrock geologic map displays the type,
  location, and geologic age of the rocks underlying the state. The map is a compilation
  of decades of work by geologists who mapped individual portions of the state at
  various times. Polygon features found in these data display the location and extent
  of each mapped bedrock body in the state at a scale of 1:250,000. The online version
  of this CD contains digital datasets of the State map that are intended to assist
  the professional geologist, land-use planners, water resource professionals, and
  engineers and to inform the interested layperson. In addition to the bedrock geology,
  the datasets include geopolitical and hydrologic information, such as political
  boundaries, quadrangle boundaries, hydrologic units, and water-well data. A more
  thorough explanation for each of these datasets may be found in the accompanying
  metadata files. Data available for download. \",\n\t\"license_title\": null,\n\t\"extras\":
